function openCloseDivBox (nameID,classHidden,classShow,btnName,iconOpen,iconClose) {
    var divElem = document.getElementById(nameID);
    var btnElem = document.getElementById(btnName);
    
    if (!divElem){
         return; 
    }
    
    // Element anpassen
    if (divElem.className.search(classHidden) > -1){
        divElem.className = divElem.className.replace (classHidden,classShow);
        
        if (btnElem){
            btnElem.className = btnElem.className.replace (iconOpen,iconClose);
        }
    } else if (divElem.className.search(classShow)  > -1){
        divElem.className = divElem.className.replace (classShow,classHidden);
        
        if (btnElem){
            btnElem.className = btnElem.className.replace (iconClose,iconOpen);
        }
    }  
    
}


